int main()
{
    fastIO();
    //findCycle();
    
    const lli startCycle = 516914;
    const lli startCycleIndex = 350125310;
    const lli lengthCycle = 182129209;
    const lli totalCiclo = 91029304;
    const lli totalLlegar = 175147925;

    
    lli n; cin>>n;
    if(n==0)
    {
        cout << 0 << endl;
        return 0;
    }
    n--;
    lli ans = 0;
    if(n <= startCycleIndex)
    {
        lli aux = n/200000;
        lli start = f(precalculado[aux].first), idx = aux*200000,  ans = precalculado[aux].second;
        while(idx < n)
        {
            ans += (start&1?0:1);
            idx++;
            start = f(start);
        }
        cout << ans << endl;
    }
    else
    {
        ans = totalLlegar;
        n -= startCycleIndex;
        if( n >= lengthCycle)
        {
            //cout << n << endl;
            lli cabe = n / lengthCycle;
            //cout << cabe << endl;
            ans += cabe*totalCiclo;
            n -= cabe*lengthCycle;
        }
        if(n>=0)
        {
            assert(n < lengthCycle);
            lli start = startCycle;
            for(int i = 0; i<=n; i++)
            {  
                ans += (start&1?0:1);
                start = f(start);
            }
        }
        cout << ans << endl;
    }
    
    return 0;
}